import MenuEspecialidades from '../Pages/Admin Restaurante/Especialidades';
import layoutMenu from '../Layouts/LayOutMenu';

const routes = [{

    path: '/Especialidades',
    component: layoutMenu,
    exact: false,
    routes: [
        {
            path: "/Especialidades",
            component: MenuEspecialidades,
            exact: true

        }
    ]

}
];


export default routes;
